<script>
// JavaScript Document
$(document).ready(function(e) {
    $(".category-box").each(function(e){
        $(this).hover(function(){
           $(this).find('.category-title').slideDown(500);
        },function(){
           $(this).find('.category-title').slideUp(500); 
        });
    });
    if($(".homepage").length > 0)
    {   
        $(document).ready(function(){
