            {
                $(this).parent("li").removeClass('open');    
                $(this).parent("li").find('ul').slideUp(500);
                return false;
            }
            else
            {
                $(this).parent("li").find('ul').slideDown(500);
                $(this).parent("li").addClass('open');
                return false;
            }
        });
    }
